  false,\n\t\"url\": null,\n\t\"notes\": \"This shapefile is an vegetation map of
  Appomattox Court House National Historical Park, Virginia. It was developed by The
  Virginia Department of Conservation and Recreation, Division of Natural Heritage
  in cooperation with North Carolina State University's Center for Earth Observation
  for the Northeast Region of the National Park Service. The data was created following
  general guidelines set forth by the USGS-NPS Vegetation Mapping Program. Map classes
  are crosswalked to the U.S. National Vegetation Classification (USNVC) or level
  II of the Andersons land use land cover classification system. Crosswalks to the
  USNVC were determined on September 27, 2007. The map is based on field work performed
  in the summer of 2002-2004 and photo interpretation of aerial photo mosaics produced
  by North Carolina State University Center for Earth Observation from photography
  obtained in December 2000 and October 2001.\",\n\t\"license_title\": null,\n\t\"extras\":
